import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const name = "ANR";
const img1 = "https://picsum.photos/201/300";
const img2 = "https://picsum.photos/202/300";
const img3 = "https://picsum.photos/203/300";

const img4 = "https://picsum.photos/204/300";
const img5 = "https://picsum.photos/205/300";
const img6 = "https://picsum.photos/206/300";

const website = "https://aetherstudios.blogspot.com/";

// .heading {
//     color: #fa9191;
//     text-align: center;
//     text-transform: capitalize;
//     font-weight: bold;
//     text-shadow: 0px 2px 4px #ffe9c5;
//     font-family: "Josefin Slab", serif;
//     /* margin: 50px 0s; */
//   }

const heading = {
  color: "#fa9191",
  textAlign: "center",
  textTransform: "capitalize",
  fontWeight: "bold",
  textShadow: "0px 2px 4px #ffe9c5",
  fontFamily: '"Josefin Slab", serif',
  margin: "50px 0s",
};

ReactDOM.render(
  <>
    <h1 style={heading}> my name is {name}</h1>

    <div className="img_div">
      <img src={img1} alt="Pic" />
      <img src={img2} alt="Pic" />
      <img src={img3} alt="Pic" />
      <img src={img4} alt="Pic" />
      <img src={img5} alt="Pic" />
      <a href={website}>
        <img src={img6} alt="Pic" />
      </a>
    </div>
  </>,
  document.getElementById("root")
);
